description:
John Cusack is, like most of his characters, an unconventional hero. Wary of fame and repelled by formulaic Hollywood fare, the Chicago-born actor has built a successful career playing underdogs and odd men out--all the while avoiding the media spotlight. With the exception of mom Nancy (a former math teacher)...


